import React from 'react';
import coffeeShops from './coffeeShops';  // Assuming the file is named coffeeShops.js and is in the same directory

const Home = () => {
  return (
    <div>
      <h1>Welcome to the Coffee Experience Catalog</h1>
      <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
        {coffeeShops.map((shop) => (
          <div key={shop.id} style={{ margin: 20, border: '1px solid #ccc', padding: 10, width: 300 }}>
            <img src={shop.image} alt={shop.name} style={{ width: '100%', height: 200, objectFit: 'cover' }} />
            <h2>{shop.name}</h2>
            <p>{shop.description}</p>
            <p><strong>Price: ${shop.price}</strong></p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
